import React from 'react';
import 'bootstrap/dist/css/bootstrap.min.css';

function App() {
  return (
    <div className="App">
      <div className="container mt-4">
        <h1>Todo App Test</h1>
        <p>If you can see this, React is working!</p>
        <button className="btn btn-primary">Test Button</button>
      </div>
    </div>
  );
}

export default App;
